export default function Navbar() {

    return (
        <div>
            <nav style={{ padding: "1rem", background: "#f0f0f0"}}>
                <button className="btn btn-danger" onClick={() => handleLogout}>Delete</button>
            </nav>
            <div className="main-content">
                <Outlet /> 
            </div>
        </div>
    )
}
